import React from 'react';
import { useLocation } from 'react-router-dom';

function Page2() {
    const location = useLocation();
    const { formData, plusPages } = location.state || {};

    return (
        <div>
            <h1>작품 정보 확인</h1>
            <h2>출품자 정보</h2>
            <p>성함: {formData?.name}</p>
            <p>아이디: {formData?.id}</p>
            <p>연락처: {formData?.contact}</p>

            <h2>작품 정보</h2>
            {plusPages?.map((page, index) => (
                <div key={index}>
                    <h3>작품 {index + 1}</h3>
                    <p>작품 제목: {page.title}</p>
                    <p>작품 내용: {page.content}</p>
                    <p>감독명: {page.director}</p>
                    <p>배우명: {page.actors}</p>
                    <p>추가 입력 사항: {page.additionalInfo}</p>
                </div>
            ))}
        </div>
    );
}

export default Page2;
